#Finds the index where a pattern appears in a string
def patternOccurence(pattern, genome):
	stIndex = ""
	patLength = len(pattern)
	
	for i in range(len(genome) - len(pattern)):
		if genome[i: i + patLength] == pattern[0:patLength]:
			stIndex += str(i) + " "

	return stIndex[:-1]

